endStringId :: Positioned [ByteString] -> Int -> Positioned ByteString -> Int -> Positioned ByteString -> Tokens
endStringId rs _ _ _ inp' = (Tok_StringId $ B.concat $ reverse $ value rs) :@@ between rs inp' ::> scanTokens inp'

